import botao from './nav.module.css';


export default function Menuh(){
    
    return(
        <div >
            <svg height="20" width="500" id="bot" className={botao.bot_h}>
            <path d="M 5 20 l 45 0"  stroke="yellow" stroke-width="3" fill="none" />
            <path d="M 20 30 l 30 0" stroke="white" stroke-width="3" fill="none" />
            <path d="M 35 40 l 15 0" stroke="white" stroke-width="3" fill="none" />
            </svg>
        </div>
    )
}
